<div id="第十四届中国酶工程学术研讨会" class="section level2">
<h2>第十四届中国酶工程学术研讨会</h2>
<p>第十四届中国酶工程学术研讨会于2023年8月18日在杭州召开，历时三天。该会促进酶工程基础研究及科技成果转化，加强酶工程产学届科研、生产与应用交流合作。</p>
